2層構造で車内の温度上昇を防ぎ、エアコン効率アップ。<br>
ミニバンに最適サイズ。<br>
焼け付くようなジリジリ感をもたらす「赤外線」と日焼け・肌へのダメージ等の原因「紫外線」を大幅低減。<br>
ハードコーティングフィルムで傷付きにくい。<br>
コシがあるので貼りやすい。<br>
スキージ付き。<br>
